        <MoviePoster />
        </div>
    )
  }
}

class MoviePoster extends Component {
    render() {
      return (
          <img src='https://i.ytimg.com/vi/YFgNm8wkhz8/maxresdefault.jpg'></img>
      )
    }
  }


export default Movie;
